	(165, 43, '_elementor_data', '[{"id":"3d426ec","elType":"container","settings":[],"elements":[{"id":"45ab679","elType":"widget","settings":{"editor":"<p>En SG, nos apasiona la moda y estamos aqu\\u00ed para ayudarte a expresar tu estilo \\u00fanico. Ofrecemos una amplia variedad de prendas de alta calidad, desde lo casual hasta lo elegante, para que te sientas seguro y fabuloso en cualquier ocasi\\u00f3n.<\\/p>"},"elements":[],"widgetType":"text-editor"}],"isInner":false},{"id":"15a7f67","elType":"container","settings":[],"elements":[{"id":"ce89876","elType":"widget","settings":{"image":{"url":"https:\\/\\/3.bp.blogspot.com\\/-yXwIaT0Srwk\\/VtnRhGGS3FI\\/AAAAAAABZz4\\/ZNt9vMsY-n4\\/s1600\\/Oto%25C3%25B1o%2Binvierno%2B2016%2Bmoda%2Btapados%2Bcamperas%2Bponchos%2BVitamina.jpg","id":"","size":"","source":"url"}},"elements":[],"widgetType":"image"}],"isInner":false},{"id":"9e332e2","elType":"container","settings":[],"elements":[{"id":"97472c0","elType":"widget","settings":{"editor":"<p>Nos comprometemos a brindarte una experiencia de compra excepcional, centrada en la atenci\\u00f3n al cliente y en la calidad de nuestros productos. Adem\\u00e1s, nos enorgullece trabajar con marcas y proveedores que comparten nuestros valores de sostenibilidad y \\u00e9tica en la moda.<\\/p>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}]'),
