	(250, 58, '_elementor_data', '[{"id":"066305f","elType":"container","settings":[],"elements":[{"id":"ee55771","elType":"widget","settings":{"tabs":[{"tab_title":"\\u00bfCu\\u00e1les son las opciones de pago disponibles?","tab_content":"<p>En SG, aceptamos pagos con tarjeta de cr\\u00e9dito\\/d\\u00e9bito (Visa, Mastercard, American Express) y PayPal para brindarte opciones seguras y convenientes.<\\/p>","_id":"c7cd3a5"},{"tab_title":"\\u00bfCu\\u00e1nto tiempo tardar\\u00e1 en llegar mi pedido?","tab_content":"<p>El tiempo de entrega puede variar seg\\u00fan tu ubicaci\\u00f3n y la disponibilidad del producto. Por lo general, los pedidos se procesan y env\\u00edan dentro de 1-2 d\\u00edas h\\u00e1biles. Una vez enviado, el tiempo de entrega estimado es de 3-5 d\\u00edas h\\u00e1biles dentro de Espa\\u00f1a.<\\/p>","_id":"8d59894"},{"_id":"da461d8","tab_title":"\\u00bfPuedo devolver o cambiar un art\\u00edculo si no estoy satisfecho?","tab_content":"<p>S\\u00ed, en SG queremos que est\\u00e9s completamente satisfecho con tu compra. Si por alguna raz\\u00f3n no est\\u00e1s satisfecho con tu pedido, puedes devolverlo dentro de los 14 d\\u00edas posteriores a la recepci\\u00f3n para un reembolso completo o un cambio por otro art\\u00edculo. Consulta nuestra pol\\u00edtica de devoluciones para obtener m\\u00e1s detalles.<\\/p>"},{"_id":"f6c3915","tab_title":"\\u00bfC\\u00f3mo puedo hacer seguimiento a mi pedido?","tab_content":"<p>Una vez que tu pedido haya sido enviado, recibir\\u00e1s un correo electr\\u00f3nico de confirmaci\\u00f3n con un n\\u00famero de seguimiento. Puedes utilizar este n\\u00famero para rastrear el estado de tu entrega a trav\\u00e9s de nuestra p\\u00e1gina web o del sitio web del transportista.<\\/p>"},{"_id":"59b4f9a","tab_title":"\\u00bfTienen tiendas f\\u00edsicas o solo operan en l\\u00ednea?","tab_content":"<p>Por el momento, SG opera \\u00fanicamente en l\\u00ednea. Esto nos permite ofrecer una amplia selecci\\u00f3n de productos y mantener precios competitivos para nuestros clientes.<\\/p>"}]},"elements":[],"widgetType":"accordion"}],"isInner":false}]'),
