	(43, 1, '2024-04-27 18:45:17', '2024-04-27 16:45:17', '<p>En SG, nos apasiona la moda y estamos aquí para ayudarte a expresar tu estilo único. Ofrecemos una amplia variedad de prendas de alta calidad, desde lo casual hasta lo elegante, para que te sientas seguro y fabuloso en cualquier ocasión.</p>		\n			<style>/*! elementor - v3.21.0 - 24-04-2024 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=".svg"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>										<img src="https://3.bp.blogspot.com/-yXwIaT0Srwk/VtnRhGGS3FI/AAAAAAABZz4/ZNt9vMsY-n4/s1600/Oto%25C3%25B1o%2Binvierno%2B2016%2Bmoda%2Btapados%2Bcamperas%2Bponchos%2BVitamina.jpg" title="" alt="" loading="lazy" />													\n		<p>Nos comprometemos a brindarte una experiencia de compra excepcional, centrada en la atención al cliente y en la calidad de nuestros productos. Además, nos enorgullece trabajar con marcas y proveedores que comparten nuestros valores de sostenibilidad y ética en la moda.</p>', 'Sobre nosotros', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2024-04-27 18:45:17', '2024-04-27 16:45:17', '', 25, 'http://spgr.test/?p=43', 0, 'revision', '', 0),
