14.33 32 32 32h144v144c0 17.67 14.33 32 32 32h32c17.67 0 32-14.33 32-32V304h144c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n								<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h384c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n												<a tabindex="0">¿Cuáles son las opciones de pago disponibles?</a>\n					<p>En SG, aceptamos pagos con tarjeta de crédito/débito (Visa, Mastercard, American Express) y PayPal para brindarte opciones seguras y convenientes.</p>\n															<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H272V64c0-17.67-14.33-32-32-32h-32c-17.67 0-32 14.33-32 32v144H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h144v144c0 17.67 14.33 32 32 32h32c17.67 0 32-14.33 32-32V304h144c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n								<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h384c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n												<a tabindex="0">¿Cuánto tiempo tardará en llegar mi pedido?</a>\n					<p>El tiempo de entrega puede variar según tu ubicación y la disponibilidad del producto. Por lo general, los pedidos se procesan y envían dentro de 1-2 días hábiles. Una vez enviado, el tiempo de entrega estimado es de 3-5 días hábiles dentro de España.</p>\n															<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H272V64c0-17.67-14.33-32-32-32h-32c-17.67 0-32 14.33-32 32v144H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h144v144c0 17.67 14.33 32 32 32h32c17.67 0 32-14.33 32-32V304h144c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n								<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h384c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n												<a tabindex="0">¿Puedo devolver o cambiar un artículo si no estoy satisfecho?</a>\n					<p>Sí, en SG queremos que estés completamente satisfecho con tu compra. Si por alguna razón no estás satisfecho con tu pedido, puedes devolverlo dentro de los 14 días posteriores a la recepción para un reembolso completo o un cambio por otro artículo. Consulta nuestra política de devoluciones para obtener más detalles.</p>\n															<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H272V64c0-17.67-14.33-32-32-32h-32c-17.67 0-32 14.33-32 32v144H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h144v144c0 17.67 14.33 32 32 32h32c17.67 0 32-14.33 32-32V304h144c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n								<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h384c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n												<a tabindex="0">¿Cómo puedo hacer seguimiento a mi pedido?</a>\n					<p>Una vez que tu pedido haya sido enviado, recibirás un correo electrónico de confirmación con un número de seguimiento. Puedes utilizar este número para rastrear el estado de tu entrega a través de nuestra página web o del sitio web del transportista.</p>\n															<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H272V64c0-17.67-14.33-32-32-32h-32c-17.67 0-32 14.33-32 32v144H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h144v144c0 17.67 14.33 32 32 32h32c17.67 0 32-14.33 32-32V304h144c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n								<svg viewBox="0 0 448 512" xmlns="http://www.w3.org/2000/svg"><path d="M416 208H32c-17.67 0-32 14.33-32 32v32c0 17.67 14.33 32 32 32h384c17.67 0 32-14.33 32-32v-32c0-17.67-14.33-32-32-32z"></path></svg>\n												<a tabindex="0">¿Tienen tiendas físicas o solo operan en línea?</a>\n					<p>Por el momento, SG opera únicamente en línea. Esto nos permite ofrecer una amplia selección de productos y mantener precios competitivos para nuestros clientes.</p>', 'Preguntas Frecuentes', '', 'publish', 'closed', 'closed', '', 'preguntas-frecuentes', '', '', '2024-04-27 19:58:44', '2024-04-27 17:58:44', '', 0, 'http://spgr.test/?page_id=54', 0, 'page', '', 0),
